sys_variable_value.value:
(function execute(inputs, outputs) {
    var wot = new GlideRecord('wm_task');
if (wot.get(inputs.variable)) {
    var result = new SMAutoAssignment().autodispatch(wot);
    
    if (result.startsWith("info")) {
        gs.info(result.substring(4));
    } else if (result.startsWith("error")) {
        gs.error(result.substring(5));
    }

    wot.update();
} else {
    gs.error("No se encontró el Work Order Task con sys_id: " + inputs.variable);
}

})(inputs, outputs);

