sys_variable_value.value:
(function execute(inputs, outputs) {
	var grTask = new GlideRecord('wm_task');
	if (grTask.get(inputs.task)) {
		var returnValue = new global.SMAutoAssignment().autodispatch(grTask);

		if (returnValue.startsWith("info")) {
			gs.info(returnValue.substring(4));
		} else if (returnValue.startsWith("error")) {
			gs.error(returnValue.substring(5));
		}
	} else {
		gs.error("No se pudo obtener el registro Work Order Task con sys_id: " + inputs.task);
	}
})(inputs, outputs);

